/**
 * Increase the global counter variable with 1
 */
const addCounter = () => {
    counter++;
}

/**
 * Sets the cracks in the lazy button
 * @param {*} e 
 */
const crackMe = (e) => {
    const parentTag = document.getElementById("Frame");
    const toRemove = document.getElementById("LAZY!!");
    addCounter();

    if (counter == 1) {
        // eerste keer voegen we dus de eerste 2 barsten toe
        parentTag.appendChild(newPath_1);
        parentTag.appendChild(newPath_2);
    } else if (counter == 2) {
        // 2de click de volgende 2
        parentTag.appendChild(newPath_3);
        parentTag.appendChild(newPath_4);
    } else if (counter == 3) {
        parentTag.appendChild(newPath_5);
        parentTag.appendChild(newPath_6);
    } else if (counter == 4) {
        parentTag.appendChild(newPath_7);
        parentTag.removeChild(toRemove);
    }
}

